import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <menu className="App">
      <li><a href='#'>About</a></li>
      <li><a href='#'>Doc</a></li>
      <li><a href='#'>Contacts</a></li>
      <li><a href='#'>Feedback</a></li>
    </menu>
  );
}

export default App;
